ties;\r\n \r\nSession session = new Session(dbURL, dbUser, dbPassword);\r\nDataLogicSales logicsale = new DataLogicSales();\r\nlogicsale.init(session);\r\nDataLogicSystem logicsystem = new DataLogicSystem();\r\nlogicsystem.init(session);\r\nProperties p = logicsystem.getResourceAsProperties(hostname + \"/properties\");\r\nString loc = p.getProperty(\"location\");\r\n \r\nproduct = line.getProductID();\r\nunits = logicsale.findProductStock(loc,product,null);\r\nmultiply = 0;\r\n \r\nif (line.isProductService() == true) {\r\n    javax.swing.JOptionPane.showMessageDialog(null, \"This is a Service and Stock Level is not checked\", \"Stock Check\", JOptionPane.WARNING_MESSAGE);\r\n} else {\r\n    \r\n    for (int i= 0; i < ticket.getLinesCount(); i++) {\r\n        row = ticket.getLine(i);\r\n        if (row.getProductID() == product) {\r\n            multiply = multiply + row.getMultiply();\r\n        }\r\n    }\r\n    diff = units - line.getMultiply() - multiply;\r\n        if (diff < 0.0) {\r\n            javax.swing.JOptionPane.showMessageDialog(null, \"Not enough stock at this Location \" + loc + \" - Use Stock Diary to Add Stock to Inventory\", \"Stock Check\", JOptionPane.WARNING_MESSAGE);\r\n	    return \"Cancel\";\r\n	 } else {\r\n	    return null;\r\n	 }\r\n }'),('63','script.StockCurrentSet',0,'// script.StockCurrentSet\r\n// This script checks Stock Level for a sale item\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n \r\n import com.openbravo.pos.forms.DataLogicSales;\r\n import com.openbravo.pos.forms.DataLogicSystem;\r\n import com.openbravo.data.loader.Session;\r\n import java.util.Properties;\r\n \r\n Session session = new Session(dbURL, dbUser, dbPassword);\r\n DataLogicSales logicsale = new DataLogicSales();\r\n logicsale.init(session);\r\n DataLogicSystem logicsystem = new DataLogicSystem();\r\n logicsystem.init(session);\r\n Properties p = logicsystem.getResourceAsProperties(hostname + \"/properties\");\r\n String loc = p.getProperty(\"location\");\r\n \r\n product = line.getProductID();\r\n isserv = line.isProductService();\r\n units = logicsale.findProductStock(loc,product,null);\r\n multiply = 0;\r\n index = sales.getSelectedIndex();\r\n \r\n  if (line.isProductService() == true) {\r\n	javax.swing.JOptionPane.showMessageDialog(null, \"This is a Service and Stock Level is not checked\");\r\n  } else {\r\n\r\n	 if (index != -1) {\r\n	     currentrow = ticket.getLine(index);\r\n	     multiply = multiply - currentrow.getMultiply();\r\n	 }\r\n	 for (int i= 0; i < ticket.getLinesCount(); i++) {\r\n	     row = ticket.getLine(i);\r\n	     if (row.getProductID() == product) {\r\n	        multiply = multiply + row.getMultiply();\r\n	     }\r\n	 }\r\n	 diff = units - line.getMultiply() - multiply;\r\n	 if (diff < 0.0) {\r\n	    javax.swing.JOptionPane.showMessageDialog(null, \"Not enough stock at this Location \" + loc + \" - Please use Stock Diary to Add Stock to Inventory\", \"Stock\", JOptionPane.WARNING_MESSAGE);\r\n	    return \"Cancel\";\r\n	 } else {\r\n	         return null;\r\n	 }\r\n }'),('64','script.totaldiscount',0,'// script.totaldiscount\n// This script applies UsersInput% Discount for the Total Receipt value\n//\n//    uniCenta oPOS - Touch Friendly Point Of Sale\n//    Copyright (c) 2009-2017 uniCenta\n//    http://sourceforge.net/projects/unicentaopos\n//\n//    This file is part of uniCenta oPOS.\n//\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    uniCenta oPOS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n// **************************************************************************\n// This script applies UsersInput% Discount for the Total Receipt value\n\n\nimport com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo; \n\ndiscountrate = 1 - (sales.getInputValue())/100;\n\nindex = sales.getSelectedIndex();\nif (index >= 0) {\n    if (ticket.getTotal() > 0.0 && discountrate > 0.0) {\n        sdiscount = Formats.PERCENT.formatValue((1-discountrate));\n        for (int number= 0; number < ticket.getLinesCount(); number++) {\n            line = ticket.getLine(number);\n            ticket.setLine(number,\n            new TicketLineInfo(\n                    line.getProductID(),\n                    line.getProductName() + \" - \" + sdiscount,\n                    line.getProductTaxCategoryID(),\n                    line.getMultiply(),\n                    (double)Math.rint(line.getPrice() * discountrate *100) /100d,\n                    line.getTaxInfo())); \n        }  \n    } else {  \n        java.awt.Toolkit.getDefaultToolkit().beep();\n    }\n} else {\n    java.awt.Toolkit.getDefaultToolkit().beep();\n}'),('65','payment.cash',0,'//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// *************************************************************************\r\n\r\npayment.addButton(\"note.2000\", 2000.0);\r\npayment.addButton(\"note.500\", 500.0);\r\npayment.addButton(\"note.100\", 100.0);\r\npayment.addButton(\"note.50\", 50.0);\r\npayment.addButton(\"note.20\", 20.0);\r\npayment.addButton(\"note.10\", 10.0);\r\npayment.addButton(\"note.5\", 5.0);\r\npayment.addButton(\"coin.2\", 2.0);\r\npayment.addButton(\"coin.1\", 1.0);'),('66','ticket.addline',0,'// ticket.addline\n// Use when you want to do something after a new line added in sales screen\n//\n//    uniCenta oPOS - Touch Friendly Point Of Sale\n//    Copyright (c) 2009-2017 uniCenta\n//    http://sourceforge.net/projects/unicentaopos\n//\n//    This file is part of uniCenta oPOS.\n//\n//    uniCenta oPOS is free software